import React, { Component } from 'react';
import anime from 'animejs';
import '../css/bst.css';

function animate() {
    anime({
        targets: '.bstnode',
        keyframes: [
            {translateX: 0},
            {translateY: 500},
            {translateX: 800, translateY: 0},
            {translateY: 500},
            {translateX: 0, translateY: 0},
        ],
        duration: 4000,
    });
}

class AnimeTest extends Component {
    constructor (props) {
        super(props);
    }

    shouldComponentUpdate(){
        return false;
    }

    componentDidMount(){
        animate();
    }


    render(){ 
        return(
            <div>
                <div className="bstnode">Test one.</div>
            </div>
        );
    }
}

export default AnimeTest;
